import React from "react";
import { useLocation } from "react-router-dom";

const Transfer = () => {
  const location = useLocation();
  const asset = location.state?.asset; // Get asset details from navigation state

  return (
    <div>
      <h2>Transfer Asset</h2>
      <form>
        <label>Asset Name:</label>
        <input type="text" value={asset?.assetName || ""} readOnly />

        <label>Serial Number:</label>
        <input type="text" value={asset?.serialNumber || ""} readOnly />

        <label>Tracking ID:</label>
        <input type="text" value={asset?.trackingId || ""} readOnly />

        <label>Transfer To:</label>
        <input type="text" placeholder="Enter recipient" />

        <button type="submit">Transfer</button>
      </form>
    </div>
  );
};

export default Transfer;
